insert into arc_tr values (51367, "Тульская область, Узловая", "Продаю 3 ком. кварт. улуч. планировки, все комнаты раздельные.Общая площадь 63 кв.м. За квартиру очень небольшая оплата так как у нас АОГВ. Отличный ремонт, в квартире есть все ( подогрев полов , кондиц, и т.д.), подвал под домом,счетчики на воду и на газ, индивидуальное отопление.Чистая вода круглые сутки,новый отдельный водовод,недавно построен. У нас экологически чистый район, в шаговой доступности школа,сад,магазины,салон красоты,медицинская клиника. В шаговой доступности озеро с пляжем. В летний период просто рай. Зимой лыжи и коньки все рядом. Если вы любите заниматься земледелием ,отдадим дачу в подарок,которая находится недалеко. Телефоны: +7 905 111 .... +7 905 111-91-13 Показать телефон", "[Общая информация:, Этаж: 2 / 5, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 68 м², Площадь комнат: 20 20 18 м², Жилая площадь: 58 м², Площадь кухни: 9 м², Санузел: 1 разд., Балкон: 1 балк., Лифт: нет, Вид из окна: двор и улица]" ,"+7 905 111-91-13", "2850000", "Продажа Тула 3-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/2946016/", "ru", "RUB");
