insert into arc_tr values (51375, "Тульская область, Венев, Южный микрорайон", "Продается меблированная 4-комнатная квартира, общей площадью 100 м2, с хорошим ремонтом на 1 этаже 5-этажного кирпичного дома. Дом находится рядом с парком в мкр. Южный, д. 38а. От МКАД по трассе М4 Москва-Дон 150 км. Развитая инфраструктура: детские площадки, спорткомплекс, парк, детский сад, школа, магазины, поликлиника, спортивные площадки, ж/д станция 10 м.п. Экологически чистое место в стороне от транспортной магистрали и промышленных зон. В квартире 4 изолированные комнаты, площадью 21 11 10 19 м2, просторная кухня площадью 9 м2, застекленная и утепленная лоджия, с/у раздельный в плитке: джакузи. Теплые полы везде, где плитка: в СУР, коридоре, кухне. В жилых комнатах пол - ламинат. Пластиковые стеклопакеты. Металлическая дверь. Межкомнатные двери деревянный массив. Квартира продается со всей мебелью. Мебель качественная, итальянских производителей. На кухне: встроенная мебель и бытовая техника: холодильник, посудомоечная машина, СМА, микроволновая печь, варочная поверхность, духовой шкаф. Коридоре: шкаф-купе до потолка. Детская. Мягкая мебель. Гостиная. Спальня все есть. Заезжай и живи. Все документы готовы. Прямая продажа Телефоны: +7 905 622 .... +7 905 622-98-96, +7 929 904-11-09 Показать телефон", "[Общая информация:, Этаж: 1 / 5, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 100 м², Площадь комнат: 21 11 10 19 м², Жилая площадь: 61 м², Площадь кухни: 9 м², Санузел: 1 разд., Балкон: 1 лодж., Лифт: нет, Вид из окна: двор и улица]" ,"+7 905 622-98-96, +7 929 904-11-09", "4000000", "Продажа Тула 4-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/2862418/", "ru", "RUB");
