insert into arc_tr values (51381, "Тульская область, Тула, улица Галкина, 256", "Уважаемые клиенты! Продается 2-комнатная квартира, в сданном клубном доме, 60/48/12 кв. м, 2/3- этажного кирпичного дома, пластиковые окна, индивидуальное отопление 2 контурный котел Аристон высота потолков 3,5 метра все коммуникации центральные. В продаже имеются 4 гаража пл. 25 кв.м. по цене 1000 000 руб. К квартирам 1 этажа прилагается земельный участок 1 сотка. Клубный дом состоит 1-2-3 ком квартир свободной планировки, в доме выполнена стяжка штукатурка , установлено индивидуальное отопление , счетчики на газ , свет , и воду .Дом обслуживается собственной управляющей компанией. Цена на 1- м и мансардном этаже 55 000 рублей, на 2 и 3 этажах 60 000 рублей за квадратный метр. По всем вопросам звоните тел: 8-953-965-55-11 Виктор Иванович Телефоны: +7 953 965 .... +7 953 965-55-11 Показать телефон", "[Общая информация:, Этаж: 2 / 3, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 60 м², Площадь комнат: 40 м², Жилая площадь: 48 м², Площадь кухни: 12 м², Санузел: 1 разд., Балкон: 1 лодж., Лифт: нет, Вид из окна: двор]" ,"+7 953 965-55-11", "55000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/2870036/", "ru", "RUB");
