insert into arc_tr values (51383, "Тульская область, поселок Шварцевский, улица Ленина, 16", "Продаю 1-х комн.кв-ру, в пос.Шварцевский, в доме с улучшенной планировкой. Не угловая, с лоджией. Стояки, трубы, канализация- новые полипропиленовые. С/у совм., новый эл. водонагреватель аристон, новая газовая плита. Чистая, светлая, солнечная сторона. Отличные соседи, в подъезде сделан капитальный ремонт.Домофон. Рядом школа 11 летка,муз.школа, детский садик, много магазинов, дом культуры, аптека, сбербанк, почта, поликлиника, ж/д станция и автостанция 5-7 мин.пешком. Хорошее транспортное сообщение с Тулой, Новомосковском, Киреевском, Узловой - электричка Тула-Новомосковск (до Тулы 30 мин.). ж/д и а/тр-ходят по расписанию. Ежедневно ходит прямой автобус из Москвы от метро Красногвардейская (вр. отпр. в 9ч.30мин. автобус Москва - Липки, в пос. Шварцевский в 12.00 ч. ) по трассе М4. От МКАДа 170 км. по трассе Ростов-Дон. В поселке есть большой водоем 2,5 км. - хорошее место для отдыха и рыбалки. Один собственник. Никто не зарегистрирован, не проживает. Чистая продажа. Ипотека, кредит, мат.капитал приветствуется. Телефоны: +7 906 624 .... +7 906 624-53-55 Показать телефон", "[Общая информация:, Этаж: 1 / 5, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 30 м², Площадь комнат: 17 м², Жилая площадь: 17 м², Площадь кухни: 7 м², Санузел: 1 совм., Балкон: 1 лодж., Лифт: нет, Вид из окна: двор]" ,"+7 906 624-53-55", "620000", "Продажа Тула 1-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3289227/", "ru", "RUB");
