insert into arc_tr values (51387, "Тульская область, поселок Сосновый", "Продам 1к квартиру в поселке Сосновый (Заокский район) по Симферопольскому шоссе в 90 км от МКАДа. Квартира (30 м178) на 1-м этаже 4-х этажного панельного дома. Коммуникации: централизованное отопление, вода, свет, газ, с/у совмещен. Имеется застекленный балкон. Квадратура комнат и кухни указаны на схеме фото. Проведены в квартиру новые трубы, как на отопление так и на воду. Рядом в 2-х минутах: магазинчик с продуктами, школа, детский садик (родители привозят своих детей даже с ближайших поселков) спорт-комплекс, магазин Дикси (минута ходьбы) и т.д. От поселка 7-15 мин. до р. Оки (на машине). Автобусная остановка (автобус 32) едет до Серпухова. Ж/д станция 107 км Курского направления. Так же рядом трасса М2 (от 5 минут в быстром до 15 минут в спокойном движении) где автобусы и маршрутки останавливаются как на Тулу так и на Москву. Рядом лес (Грибы, ягоды). Очень тихое и спокойное место для жизни. Добрые и отзывчивые соседи. Все вопросы по телефону. Телефоны: +7 920 766 .... +7 920 766-44-41, +7 910 164-45-38 Показать телефон", "[Общая информация:, Этаж: 1 / 4, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 30 м², Площадь комнат: 15 м², Жилая площадь: 15 м², Площадь кухни: 6 м², Санузел: 1 совм., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 920 766-44-41, +7 910 164-45-38", "990000", "Продажа Тула 1-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3000582/", "ru", "RUB");
insert into arc_tr values (51388, "Тульская область, поселок Маяк", "Продается 2х комнатная квартира. Квартира на первом этаже в поселке Маяк по Симферопольскому шоссе (105 км от МКАДа). Общая площадь квартиры 45кв. м. (Комнаты: 18 кв.м. и 14.). Кухня, с/у совмещен, прихожая. Есть вода, свет, газ, автономное отопление. Окна выходят на восток во двор. Красивый вид из окон. Рядом р. Ока. В поселке есть продуктовый магазин. Автобусная остановка (автобус 32) едет до Серпухова каждый час. Вокруг гребные леса с ягодами! Очень тихое и спокойное место для жизни. Есть 2 участка по 4 сотки (покупателю в подарок). В 3х километрах поселок Сосновый, где есть тоже магазинчики с продуктами, школа, детский садик (родители привозят своих детей с ближайших поселков), магазин Дикси, почта, МЧС, Баня, больница и т.д. От поселка 7-15 мин. до р. Оки (на машине). Все вопросы по телефону. За срочность торг. Телефоны: +7 920 766 .... +7 920 766-44-41, +7 910 164-45-38 Показать телефон", "[Общая информация:, Этаж: 1 / 2, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 45 м², Площадь комнат: 17 12 м², Жилая площадь: 29 м², Площадь кухни: 6 м², Санузел: 1 совм., Балкон: нет, Лифт: нет, Вид из окна: двор]" ,"+7 920 766-44-41, +7 910 164-45-38", "990000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3316989/", "ru", "RUB");
