insert into arc_tr values (51397, "Тульская область, поселок Плеханово", "ПРОДАЮТСЯ 1 КОМН. КВ-РЫ ОТ 35,25 КВ.М. НА 1/ 5 ЭТ. КИРПИЧНОГО ДОМА ПО 35000 РУБ ЗА КВ.М. (1233750 РУБ.) В СТРОЯЩЕМСЯ ЖК НОВОЕ ЗАРЕЧЬЕ. Жилой комплекс Новое Заречье- это комфортное проживание в современных домах вблизи от города в экологически чистой зоне. Территориально жилой комплекс находится в поселке городского типа Плеханово в Ленинском районе Тульской области, непосредственно примыкая к областному центру. В поселке работают физкультурно-оздоровительный комплекс, 2 средних школы, 2 дошкольных образовательных учреждения. Строительство ЖК Новое Заречье является первым этапом застройки данного района. В перспективе предполагается строительство ряда подобных комплексов, объединенных в единый современный поселок клубного типа с полным комплексом объектов инженерной, социальной, дорожной инфраструктуры и благоустройством прилегающей территории. Квартиры сдаются без окончательной отделки (стены не оштукатурены, не шпатлеваны, без оклейки обоями, потолки не окрашены), с гидроизоляцией санузлов, без остекления лоджий и балконов. Срок реализации проекта июль 2015 года Телефоны: +7 953 965 .... +7 953 965-55-44 Показать телефон", "[Общая информация:, Этаж: 1 / 5, Тип дома: новостройка, кирпичный, Тип продажи: свободная, Общая площадь: 35 м², Площадь комнат: 21 м², Жилая площадь: 21 м², Площадь кухни: 13 м², Санузел: 1 разд., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 953 965-55-44", "1237750", "Продажа Тула 1-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3043198/", "ru", "RUB");
