insert into arc_tr values (51402, "Тульская область, Болохово, улица Ленина, 34", "Продаю 2-х комн. квартиру в городе Болохово вместе с гаражом 3,5 м. на 5м.- находится под окнами квартиры в пяти метрах. Комнаты изолированы 19 кв.м. и 16 кв.м. Большой коридор 6,3 кв.м. Кухня 10 кв.м. Две кладовые. Ванна и сан.узел совместные 5,1 кв.м., ОАГВ-двухконтурный, колонка-автомат. Пластиковые окна, есть балкон. Двойная дверь-первая металлическая, вторая пластиковая. Комнаты выходят на северо-запад и юго-восток Квартира в отличном состоянии, хорошие соседи, подъезд на ночь закрывается. Хорошее транспортное сообщение с городом Тулой (17 км. от Тулы, 15 мин. на маршрутке). Чистая продажа. Можно в ипотеку. Ежедневно со ст. м. Красногвардейская в 9.30 ходит рейсовый автобус Москва-Липки (через г.Болохово, в Болохово прибывает в 12.30.). Телефоны: +7 953 433 .... +7 953 433-84-77 Показать телефон", "[Общая информация:, Этаж: 2 / 2, Тип дома: вторичка, блочный, Тип продажи: свободная, Общая площадь: 58 м², Площадь комнат: 18 16 м², Жилая площадь: 35 м², Площадь кухни: 10 м², Санузел: 1 совм., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 953 433-84-77", "1350000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3234660/", "ru", "RUB");
