insert into arc_tr values (51404, "Тульская область, поселок Обидимо", "Уважаемые клиенты! По данному объекту возможен ТОРГ ! По всем вопросам звоните: 8950-907-79-35 Александр Чистая продажа. В собственности более 3 лет. Поможем с оформлением ипотеки. Продается 2-комнатная квартира, 45/28/6 кв. м, 2 / 2-этажного кирпичного дома, хорошее состояние, пластиковые окна, новые межкомнатные двери, новые трубы, санузел раздельный. Высокие потолки, есть погреб во дворе дома. Развитая инфраструктура. Рядом находятся детский сад, школа, магазины, поликлиника, остановка общественного транспорта маршрутное такси до Тулы каждые 10 мин, Квартира более 3-х лет в собственности. Телефоны: +7 950 907 .... +7 950 907-79-35 Показать телефон", "[Общая информация:, Этаж: 2 / 2, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 45 м², Площадь комнат: 28 м², Жилая площадь: 28 м², Площадь кухни: 6 м², Санузел: 1 разд., Балкон: нет, Лифт: нет, Вид из окна: двор]" ,"+7 950 907-79-35", "1400000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3118646/", "ru", "RUB");
