insert into arc_tr values (51405, "Тульская область, Алексин", "Продается однокомнатная квартира 32 кв. м. по улице Мира в городе Алексин Тульской области. Балкон застеклен, окна ПВХ, высокие потолки, пол - ламинат, трубы пластиковые, с/у совмещен. Расположение в самом центре города. Рядом школа, детский сад, торговые центры, река, пляж. Хорошее транспортное сообщение. Телефоны: +7 920 271 .... +7 920 271-01-01 Показать телефон", "[Общая информация:, Этаж: 3 / 4, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 32 м², Площадь комнат: 20 м², Жилая площадь: 20 м², Площадь кухни: 5 м², Санузел: 1 совм., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 920 271-01-01", "1400000", "Продажа Тула 1-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3057343/", "ru", "RUB");
insert into arc_tr values (51406, "Тульская область, деревня Барсуки", "Уважаемые клиенты! Недорого! Продается 2-комнатная квартира, 44/23/6 кв. м, 1/5-этажный кирпичный дом, этаж высокий возможно сделать балкон, квартира под ремонт, пластиковые окна, солнечная сторона, санузел раздельный. Различные варианты оплаты, чистая продажа, помощь в оформлении ипотеки. Телефоны: +7 953 953 .... +7 953 953-33-88 Показать телефон", "[Общая информация:, Этаж: 1 / 5, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 44 м², Площадь комнат: 23 м², Жилая площадь: 23 м², Площадь кухни: 6 м², Санузел: 1 разд., Балкон: нет, Лифт: нет, Вид из окна: двор]" ,"+7 953 953-33-88", "1450000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3122388/", "ru", "RUB");
