insert into arc_tr values (51407, "Тульская область, поселок Велегож", "Продам 2к квартиру в поселке Велегож (Заокский район) по Симферопольскому шоссе в 110 км от МКАДа. Квартира (распашонка 54 м178) на 2-м этаже 3-х этажного кирпичного дома. Окна выходят как на одну, так и на другую сторону дома. Зимой очень жаркая квартира, замена окон не требуется. Коммуникации: централизованное отопление, вода, свет, с/у раздельный и очень просторный. Квадратура комнат 14/18 кв.м и кухня 9 кв.м. Входные двери: металлическая и деревянная. На коммунальные услуги 3.500 в месяц. Есть свой подвал, пол деревянный. Два просторных коридора 8 и 7 кв.м,. Рядом магазинчик с продуктами, Дом отдыха, река Ока, футбольное поле, От поселка 20 мин. до р. Оки (пешком). Автобусная остановка едет до Заокского где Ж/д станция Тарусская Курского направления (на Москву и Тулу). Рядом лес (Грибы, ягоды). Тихое и спокойное место для жизни. Поселок Велегож жемчужина Тульской области. Незабываемое место по красоте, свежему воздуху и восхитительных впечатлений. Добрые и отзывчивые соседи. Квартира капитального ремонта не требует. Заходи и живи. Документы готовы к продажи. Все вопросы по телефону. Телефоны: +7 910 164 .... +7 910 164-45-38, +7 920 766-44-41 Показать телефон", "[Общая информация:, Этаж: 2 / 3, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 54 м², Площадь комнат: 18 14 м², Жилая площадь: 32 м², Площадь кухни: 9 м², Санузел: 1 разд., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 910 164-45-38, +7 920 766-44-41", "1450000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3262097/", "ru", "RUB");
