insert into arc_tr values (51424, "Тульская область, Тула, улица Баженова, 2", "Уважаемые клиенты! По данному объекту возможен ТОРГ ! По всем вопросам звоните: 8-930-899-01-99 Виктория Чистая продажа. В собственности более 3 лет. Поможем с оформлением ипотеки. Возможен обмен, взаимозачет Вашей недвижимости. Продается 1-комнатная квартира, 32/17/7 кв. м, 2 / 5-этажного кирпичного дома, угловая, очень теплая, светлая, состояние среднее, новые трубы и сантехника, санузел совмещенный. Развитая инфраструктура. Рядом находятся детский сад, школа, магазины, остановка общественного транспорта, парк. Квартира более 3-х лет в собственности. Один собственник. Возможны различные варианты оплаты. Телефоны: +7 930 899 .... +7 930 899-01-99 Показать телефон", "[Общая информация:, Этаж: 2 / 5, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 32 м², Площадь комнат: 17 м², Жилая площадь: 17 м², Площадь кухни: 7 м², Санузел: 1 совм., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 930 899-01-99", "1770000", "Продажа Тула 1-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3213813/", "ru", "RUB");
