insert into arc_tr values (51425, "Тульская область, поселок Сосновый", "Продам 2к квартиру в поселке Сосновый (Заокский район) по Симферопольскому шоссе в 90 км от МКАДа. Квартира (распашонка 52 м178) на 2-м этаже 4-х этажного панельного дома. Окна выходят как на одну, так и на другую сторону дома. Две больших застекленных лоджии (пластиковые окна). Коммуникации: централизованное отопление, вода, свет, газ, с/у раздельный. Площадь комнат 12/17 кв.м и кухня 8,5 кв.м. Очень теплая квартира. Рядом в 2-х минутах: магазинчик с продуктами, школа, детский садик (родители привозят своих детей даже с ближайших поселков) спорт-комплекс, магазин Дикси (минута ходьбы) и т.д. От поселка 7-15 мин. до р. Оки (на машине). Автобусная остановка (автобус 32) едет до Серпухова. Ж/д станция 107 км Курского направления. Так же рядом трасса М2 (от 5 минут до 15 минут в зависимости от шага) где автобусы и маршрутки останавливаются как на Тулу так и на Москву. Рядом лес (Грибы, ягоды). Очень тихое и спокойное место для жизни. Добрые и отзывчивые соседи. Квартира ремонта не требует. Заходи и живи. Прописанных нет. Документы готовы к продажи. Возможен торг. Все вопросы по телефону. Телефоны: +7 910 164 .... +7 910 164-45-38, +7 920 766-44-41 Показать телефон", "[Общая информация:, Этаж: 2 / 4, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 52 м², Площадь комнат: 17 12 м², Жилая площадь: 29 м², Площадь кухни: 9 м², Санузел: 1 разд., Балкон: 2 лодж., Лифт: нет, Вид из окна: двор и улица]" ,"+7 910 164-45-38, +7 920 766-44-41", "1790000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3179422/", "ru", "RUB");
