insert into arc_tr values (51541, "Тульская область, Тула, Ленина проспект, 112а", "Продается 3-х комн. квартира пр-т Ленина 112А, 4/10 этаж кирп. дома 2007 года постройки, площадью 91/51/15 кв.м, комнаты раздельные, лоджия, кладовка. Квартира в отличном состоянии сделан качественный ремонт по дизайн проекту. В комнатах паркет, 3-х уровневые потолки, большие пластиковые окна. На кухне мебель с встроенной техникой, полы с подогревом, кухня совмещена с лоджией. В квартире индивидуальное отопление, установлены счетчики на газ и воду, двойная входная дверь, видеодомофон, домашний телефон, интернет, кабельное и цифровое ТВ. Квартира полностью готова к проживанию заезжай и живи, мебель частично остается. Любые варианты оплаты, помощь в оформлении ипотеки. Прямая продажа. Телефоны: +7 953 960 .... +7 953 960-00-79 Показать телефон", "[Общая информация:, Этаж: 4 / 10, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 91 м², Площадь комнат: 51 м², Жилая площадь: 51 м², Площадь кухни: 15 м², Санузел: 1 совм., Балкон: 1 лодж., Лифт: 1 пасс. + 1 груз., Вид из окна: двор]" ,"+7 953 960-00-79", "6800000", "Продажа Тула 3-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3199749/", "ru", "RUB");
