insert into arc_tr values (51543, "Тульская область, Тула, проспект Ленина, 112б", "Уважаемые клиенты! По данному объекту возможен ТОРГ ! По всем вопросам звоните: 8-953-189-68-56 Роман Чистая продажа. В собственности более 3 лет. Поможем с оформлением ипотеки. Эксклюзивное предложение срочно Продается 3-комнатная квартира, 84/58/14 кв. м, 7 / 10-этажного дома, комнаты изолированы, большой коридор, кладовка, санузел раздельный, застекленная лоджия 2.5 кв.м. Индивидуальное отопление (двухконтурный газовый котёл), шикарный ремонт, водяной подогрев полов. Продаётся частично с мебелью (кухня дуб со встроенной посудомоечной машиной), шкаф-купе в спальне, стенка в зале, шкаф в прихожей, всё сделано на заказ. Спокойный район, 2 мин до пр-та Ленина, парковая зона (платоновский парк). Развитая инфраструктура, рядом находятся детский сад, школа, магазины, аптека, стоматология, поликлиника УВД, остановка общественного транспорта (порядочные и тихие соседи, две квартиры на этаже). Квартира более 3-х лет в собственности. Один собственник. Возможны различные варианты оплаты. Серьёзным покупателям серьёзный торг. Телефоны: +7 953 189 .... +7 953 189-68-56 Показать телефон", "[Общая информация:, Этаж: 7 / 10, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 84 м², Площадь комнат: 58 м², Жилая площадь: 58 м², Площадь кухни: 14 м², Санузел: 1 разд., Балкон: 1 лодж., Лифт: 1 пасс. + 1 груз., Вид из окна: двор]" ,"+7 953 189-68-56", "7900000", "Продажа Тула 3-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3043059/", "ru", "RUB");
