insert into arc_tr values (51544, "Тульская область, Тула, Красноармейский проспект, 34", "Уважаемые клиенты! По данному объекту возможен ТОРГ ! По всем вопросам звоните: 8-950-907-79-35 Александр Чистая продажа. В собственности более 3 лет. Поможем с оформлением ипотеки. Продается 4-комнатная квартира 120/95/17 кв. м, 5 /5-этажного кирпичного дома, отличное состояние евроремонт, окна выходят на обе стороны, тихий чистый дворик засаженный деревьями, возможность парковки у подъезда, совмещённый санузел (итальянская плитка), застекленный балкон. Все магазины в шаговой доступности. В подъезде всего восемь квартир, соседи очень тихие, спокойные, чистота и тишина вам обеспечены. Возможна перепланировка. Телефоны: +7 950 907 .... +7 950 907-79-35 Показать телефон", "[Общая информация:, Этаж: 5 / 5, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 120 м², Площадь комнат: 95 м², Жилая площадь: 95 м², Площадь кухни: 17 м², Санузел: 1 совм., Балкон: 1 балк., Лифт: нет, Вид из окна: двор]" ,"+7 950 907-79-35", "9000000", "Продажа Тула 4-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3117877/", "ru", "RUB");
