insert into arc_tr values (51545, "Тульская область, Тула, Первомайская улица", "Продается 4- комнатная квартира, площадью 168,81 кв.м. 12/13- этажного кирпичного дома в 1 пусковом комплексе, расположенного внутри квартала, ограниченного ул. ул. Первомайской, ул. Ф. Энгельса ул. Жаворонкова и проспектом Ленина в центре города. В состав жилых домов входят нежилые помещения, одно-, двух-, трех- и четырехкомнатные квартиры. Жилые дома оснащены современными видами инженерного оборудования (водоснабжение от городского водопровода дом оснащен отоплением и горячим водоснабжением электроснабжение от строящейся трансформаторной подстанции в каждом подъезде по два лифта (пассажирский и грузопассажирский) мусоропровод радиофикация, телефонизация, телевидение - без выполнения разводки по квартирам). Энергосберегающее решение здания включает в себя мероприятия по ограждающим конструкциям и учету расхода электроэнергии, горячей и холодной воды с установкой счетчиков на вводах в здание, в каждой квартире и в каждом нежилом помещении. Окна и балконные двери - из ПВХ-профилей с заполнением 2-х камерными стеклопакетами. Планируемое назначение нежилых помещений: п.к. - цокольный этаж - помещения для бытового обслуживания населения и занятий фитнесом - 1-й этаж - административно-офисные помещения - подземный этаж - автопарковки на 77 м/мест. В подземных этажах располагаются подземные автопарковки общей вместимостью 352 машиноместа. В цокольном и первом этажах расположены предприятия бытового обслуживания, помещения для занятий фитнесом, помещения инженерного обеспечения жилого дома, административно-офисные помещения, детский сад на 30 человек. Высота жилых этажей 3,15 м. Срок сдачи 2кв. 2015 года. Возможны различные варианты оплаты , помощь в оформлении ипотеки. По всем вопросам звоните, Ирина Васильевна. Телефоны: +7 953 965 .... +7 953 965-55-44 Показать телефон", "[Общая информация:, Этаж: 12 / 13, Тип дома: новостройка, монолитный, Тип продажи: свободная, Общая площадь: 169 м², Площадь комнат: 140 м², Жилая площадь: 140 м², Площадь кухни: 20 м², Санузел: 1 разд., Балкон: 1 лодж., Лифт: 1 пасс. + 1 груз., Вид из окна: двор]" ,"+7 953 965-55-44", "10450000", "Продажа Тула 4-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3325672/", "ru", "RUB");
