insert into arc_tr values (51546, "Тульская область, Тула, улица Демонстрации, 2", "Продаётся отличная квартира в новом, элитном жилом доме бизнес-класса в престижном месте в самом центре города. Кухня-столовая 16,0 кв.м., гостиная 23,0 кв.м., две спальни (24,0 и 15,0 кв.м.), гардеробная 9 кв.м., совмещённый санузел (10 кв.м., сантехника , Франция), большая прихожая 12 кв.м, огромная панорамная лоджия (12 кв.м., застеклена и утеплена). Качественный, дорогой ремонт: натуральный дубовый паркет, итальянская плитка, французские натяжные (тканевые) потолки, 3 кондиционера (), техника и мебель (в том числе встроенная и шкафы-купе). Видеодомофон на 2 линии (1-ая линия подъезд, 2-ая линия - этаж), телефон, отдельный закрытый блок на три квартиры, двойная дверь с тамбуром. Просторный подъезд, два лифта, консьерж, очень хорошие соседи, закрытая парковка. Удобная транспортная доступность, развитая инфраструктура, ухоженный двор. Невысокие коммунальные платежи (дом находится под управлением ТСЖ), установлены теплосчётчики (оплата отопления только в холодное время года). Свободная продажа, в собственности более трёх лет, документы от застройщика. Телефоны: +7 916 744 .... +7 916 744-86-84 Показать телефон", "[Общая информация:, Этаж: 6 / 15, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 115 м², Площадь комнат: 23,0 24,0 15,0 м², Жилая площадь: 62 м², Площадь кухни: 16 м², Санузел: 1 совм., Балкон: 1 лодж., Лифт: 1 пасс. + 1 груз., Вид из окна: двор]" ,"+7 916 744-86-84", "11100000", "Продажа Тула 3-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3278507/", "ru", "RUB");
