insert into arc_tr values (51547, "Тульская область, Донской", "Срочно!! Продается чистая и уютная 2-х комнатная квартира по цене 1-комнатной!! Микрорайон Центральный. Все необходимое имеется - заезжай и живи! комнаты смежные - 1 проходная (можно использовать в качестве комнаты для ребенка или кабинета), 1 изолированная. Все коммуникации - центральные (свет, газ, вода, канализация). Отопление - АОГВ. Горячая вода - современная автоматическая газовая колонка. Новые эл. Счетчик, проводка, защита от перепадов (Ресанта) - установлены в 2013 году. Пластиковые окна (2 года). В квартире остаются мебель, антикварное пианино (в рабочем состоянии настроенное), холодильник (зил), стиральная машина (занусси, итальянской сборки, 5 лет). В квартире имеются 2 небольших погреба и 2 маленьких подпола для хранения заготовок). Есть 3 огорода возле дома общей площадью (около 3-х соток), теплица из поликарбоната. Земля не в собственности, но можно оформить. Квартира в собственности 21 год. Полная стоимость в дкп. 2 взрослых собственника. Никто не прописан. Разумный торг уместен. Все документы готовы к продаже. Быстрый выход на сделку. Телефоны: +7 916 480 .... +7 916 480-20-73 Показать телефон", "[Общая информация:, Этаж: 1 / 1, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 42 м², Площадь комнат: 16 9,3 м², Жилая площадь: 25 м², Площадь кухни: 8 м², Санузел: 1 совм., Балкон: нет, Лифт: нет, Вид из окна: двор]" ,"+7 916 480-20-73", "750000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3352507/", "ru", "RUB");
