insert into arc_tr values (51556, "Тульская область, Тула, улица Металлургов, 49", "Продается двухкомнатная квартира. Полная стоимость в договоре, в собственности более трех лет. Во всех комнатах свежий ремонт. С/у раздельный, в кафеле до потолка. Пол ламинат, окна - пластиковые стеклопакеты, кондиционер. Квартира меблирована всем необходимым. Окна выходят на детский сад. Кроме него рядом с домом тульская классическая гимназия 1, до гимназии 300 метров. В пешей доступности супермаркеты дикси, пятерочка (5 мин пешком), остановки общественного транспорта трамваи, автобусы, маршрутки (5 мин пешком), детская и взрослая поликлиники (15 мин пешком), еще 2 школы и один детский сад. Ввиду близкого расположения школ проезд зимой к дому всегда расчищен, улицы постоянно убирают. Тихий, спокойный двор. Аргументированный торг возможен после осмотра. Телефоны: +7 920 271 .... +7 920 271-46-34 Показать телефон", "[Общая информация:, Этаж: 1 / 10, Тип дома: вторичка, панельный дом, Тип продажи: свободная, Общая площадь: 53 м², Площадь комнат: 28,5 м², Жилая площадь: 28 м², Площадь кухни: 9 м², Санузел: 1 разд., Балкон: 1 лодж., Лифт: 1 пасс., Вид из окна: улица]" ,"+7 920 271-46-34", "2899000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3380776/", "ru", "RUB");
