insert into arc_tr values (51985, "Тульская область, поселок Метростроевский", "Замечательная 2-х комнатная квартира, общей площадью 39,4 м178, жилая площадь 24,3 м178, кухня 6,9 м178, с/у раздельный, комнаты 13,2 м178 и 12,7 м178, первый этаж в двух этажном кирпичном доме, только после капитального ремонта, зелёный и тихий двор, дружные и надёжные соседи, ухоженный подъезд в котором регулярно поддерживается чистота, квартира находится в центре тихого, зелёного посёлка. В непосредственной близости от почты (50м), дом культуры(100м), администрация(200м), магазины(от30м), детский сад(250м), школа(250м), поликлиника(800м), аптека(100м), спортивная площадка(600м) и действующее футбольное поле(900м), на границе с посёлком живописные места лес (грибы, ягоды, охота), река Осётр (купаться, рыбалка). В квартире никто не прописан. В собственности более 3-х лет. Готова к продаже. Заезжай и живи! Транспортное сообщение общественным транспортом - регулярное, рейсовый автобус, маршрутки, несколько раз в день, электрички в 10 минутах пешком до станции Хрусловка Удалённость посёлка от: г.Венёв - районный центр 8,км., г.Тула 51 км., г. Москва - 140 км., до трассы М-4 4,1 км., до Москвы на авто 1 час 1 час 20 мин по скоростной новой трассе Москва-Дон М-4. Рядом крупное работающие предприятие Карьер, и в окрестности есть возможность трудоустроиться. Торг уместен! Газовый котёл в подарок! Ипотека от вашего банка! Телефоны: +7 968 448 .... +7 968 448-55-07 Показать телефон", "[Общая информация:, Этаж: 1 / 2, Тип дома: вторичка, кирпичный, Тип продажи: свободная, Общая площадь: 40 м², Площадь комнат: 13,2 12,7 м², Жилая площадь: 33 м², Площадь кухни: 7 м², Санузел: 1 разд., Балкон: нет, Лифт: нет, Вид из окна: двор и улица]" ,"+7 968 448-55-07", "790000", "Продажа Тула 2-комн. кв. ",  "NaN", "NaN", " http://www.cian.ru/sale/flat/3316731/", "ru", "RUB");
